import { useNavigate } from "react-router-dom";
import "../styles/SearchedItem.css";

const SearchedItem = ({id, image, title, content, createdDate, comments, writer, likeCount}) => {
    const navigate = useNavigate();

    const profile_image = "data:image/png;base64,";

    const goPost = () => {
        navigate(`/${writer}/${id}`);
    }
    
    return(
        <div className="SearchedItem" onClick={(goPost)}>
            <div className="user_info">
                <div className="profile_image">
                        <img alt={userName} src='https://velog.io/images/user-thumbnail.png'/>
                        <span className="username">
                            by
                            <b>{writer}</b>
                        </span>
                    </div>
                </div>
            <div className="image_section">
                <img alt={title} src={image}/>
            </div>
            <div className="content_section">
                <h4 className="post_title">{title}</h4>
                <p className="post_content">{content}</p>
                <div className="post_info"> 
                    <span className="post_date">{createdDate}</span>
                    <span>·</span>
                    <span className="post_comments">{comments}개의 댓글</span>
                </div>
            </div>
            <div className="user_section">
                
                <div className="right_col">
                    <svg viewBox="0 0 24 24"><path fill="currentColor" d="m18 1-6 4-6-4-6 5v7l12 10 12-10V6z"></path></svg>
                    {likeCount}
                </div>
            </div>
        </div>
    )
}

export default SearchedItem;
